import React from 'react';

function Footer() {
  return (
    <footer id="footer" className="footer">
      <div className="copyright">
        &copy; Copyright <strong><span>Jiffy</span></strong>. All Rights Reserved
      </div>
      <div className="credits">
        Designed by ITP_WD_B01_04
      </div>
    </footer>
  );
}

export default Footer;
